import React from 'react';
import ActionCall from './CallToAction';
import HomeScreen from './Home';
import cir from 'images/green-foreground.svg';
import cir2 from 'images/blue-blackground.svg';
import cir3 from 'images/red-foreground.svg';
import cir4 from 'images/red-background.svg';
import cir5 from 'images/yellow-foreground.svg';
import cir6 from 'images/yellow-background.svg';
import cir7 from 'images/green-background.svg';
import cir8 from 'images/white-foreground.svg';
import cir9 from 'images/white-background.svg';
import SecCir from 'images/blue-foreground.svg';
import AllServices from './AllServices';

function Welcome(){
    return (
        <div className="welcome">
      <div className="Circles">
      <img src={SecCir} className="App-logos" alt="logo" />
      <img src={cir2} className="App-logos"/>
      <img src={cir3} className="App-logos"/>
      <img src={cir4} className="App-logos"/>
      <img src={cir5} className="App-logos"/>
      <img src={cir6} className="App-logos"/>
      <img src={cir} className="App-logos"/>
      <img src={cir7} className="App-logos"/>
      <img src={cir8} className="App-logos"/>
      <img src={cir9} className="App-logos"/>
      </div>
      <ActionCall />
      <div id="desc">
        The best in online Audio Production
        </div> 
        <HomeScreen/>
        <AllServices />        
  </div>
    )
}

export default Welcome;
